def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if item <= bins[i]/3:
            if item % 4 == 0:
                priorities[i] = (item + 2) / bins[i]
            elif item % 4 == 1:
                priorities[i] = (item + 3) / bins[i]
            elif item % 4 == 2:
                priorities[i] = (item + 4) / bins[i]
            else:
                priorities[i] = (item + 5) / bins[i]
        elif item > bins[i]/3 and item <= bins[i]/2:
            priorities[i] = np.log(item / bins[i]) + np.sqrt(item / bins[i]) + np.cbrt(item / bins[i])
        elif item > bins[i]/2 and item <= 2*bins[i]/3:
            priorities[i] = np.log10(item / bins[i]) + np.square(item / bins[i]) + np.cbrt(item / bins[i])
        elif item > 2*bins[i]/3 and item <= bins[i]:
            priorities[i] = np.log1p(item / bins[i]) + np.sqrt(item / bins[i]) + np.square(item / bins[i])
        else:
            priorities[i] = np.log2(item / bins[i]) + np.log1p(item / bins[i]) + np.square(item / bins[i])

    return priorities
